script: |
  super -f text -I q5657.spq | sort > q5657.out

inputs:
  - name: q5657.spq
    data: |
      SELECT ALL - col1 / col1 AS col1 FROM tab0 (FORMAT parquet) WHERE ( - col2 * + col1 * + col0 ) NOT IN ( col1 );
  - name: tab0

outputs:
  - name: q5657.out
    data: |
      -1
      -1
      -1
